snippet.textDisplay:
Has a pretty road love song sort of feel, you know the one with open roof car and wind gushing through your soul. May be it's because both singers have soft voices that it didn't touch me. I would sway to the tune and probably not skip if it comes on the playlist but I certainly won't go looking for the song once it's over. I guess the instruments should have been kept lighter. Both Momina and Danyal have soft voices and thats why they sounded more like backup vocalists waiting for the lead singer to take the song higher and do justice to this kickass tune. Nice guitar play by Danyal. Since these days most people go looking for 'hot, cute, crashworthy' qualities in singers, I won't be surprised if this becomes the most viewed song of the season, but then to each her/his own. I for once cannot understand why sakal bannn (muazzam wala) doesn't have as many 'views'  still as Afreen Afreen, but then again - am obsolete. That said, the tune was pretty challenging for Momina and it showed. Yep! 

Love from India
@Rohwit

